import React from 'react';
import './search.component.scss';

export default function SearchComponent() {
  return (
    <>
    <div className='search'>
      <span>Search</span>
      <div>
        <div className='form-group'>
          <label>
            <input className="form-control" aria-label="Small" aria-describedby="inputGroup-sizing-sm" type='email' name='email'  /> <p />
          </label>
        </div>
      </div>
      </div>
    </>
  );
}
